"use strict";
// Basic syntax of for of Loop
// for (variable of array) {
//      statement 
// }
// Loop on an array
const myClothes = ['t-shirt', 'sweater', 'shoes', 'sunglasses', 'coat', 'pants', 'belt'];
for (const item of myClothes) {
    console.log(item);
}
console.log('-------------------------');
// Loop on string
for (const alphabet of 'hello') {
    console.log(alphabet);
}
